import React from 'react';
import './home.css';
import Navbar from 'react-bootstrap/Navbar';


function Home() {
  return (
    <div>
       <Navbar bg="light">
            <Navbar.Brand href="#home">Brand link</Navbar.Brand>
        </Navbar>
    </div>
  );
}

export default Home;
